import "./App.css"
function App(){
  return(
    <div className="App">
      <BrowserRouter> 
      <Routes> 
        <Route element={<Home/>} path="/"/>
      </Routes>
      </BrowserRouter>
     <h1>heloo </h1>
      
    </div>
  )
}
export default App;
